import lightsabersLit from '../../media/lightsabers-lit.png';
import './Cards.css';



export const Cards = () => {
    return (
        <div className="card-container" >
            <div className="card">
                <h1>A New Hope</h1>
                <img src={lightsabersLit} className="lightsabersLit" />
            </div>
            <div className="card">Card1</div>
            <div className="card">Card1</div>
            <div className="card">Card1</div>
            <div className="card">Card1</div>
            <div className="card">Card1</div>
        </div>
    )
}
